Framed for assassinating Grandmaster Fumitaka (Cary-Hiroyuki Tagawa, 47 Ronin
Tekken, Mortal Kombat), the Lost Ninja Clan must battle their way through an
underground nuclear bunker filled with hordes of supernatural enemies, mutants
and flesh eating zombies, pursued by Hiroshi's (Ernie Reyes Jr., Teenage Mutant
Ninja Turtles II, The Rundown, Indiana Jones and the Kingdom of the Crystal Skull)
unstoppable Ninja army, with orders to hunt them down. Trapped a thousand feet
below the Earth's crust, the Lost Clan will face hell. The bloody, action-packed
fantasy, martial arts, action film delivers a non-stop heart pounding, adrenaline
injected thrill ride



